// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

import "./SimpleStorage.sol";

contract ExtraStorage is SimpleStorage {
    // En este contrato lo que queremos es sumar 5 al nuevo número que la gente nos indique como su número favorito

    function store(uint256 _favoriteNumber) public override {
        favoriteNumber = _favoriteNumber + 5;
    }

    function getPrice() public {
        // Vamos a necesitar:
        // ABI
        // Dirección del contrato de chainlink encargado de dar el precio 0x8A753747A1Fa494EC906cE90E9f37563A8AF630e
        // Esa es la dirección de contrato proporcionada en la documentación de chainlink mediante la cual obtenemos la información del par ETH/USD

    }

    function getConversionRate() public {}

}

