// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

contract SimpleStorage {
    // If you put no number, the default value is ZERO
    // If you don't add the public word in variables, they will keep private so you won't be able to see them
    uint256 favoriteNumber;

    // Ahora hemos creado un diccionario en el que cada nombre va a estar asociado(mapeado) al número que antes hemos dictado como favorito de esa persona
    mapping(string => uint256) public nameToFavoriteNumber;

    struct People {
        uint256 favoriteNumber;
        string name;
    }
    //uint256[] public favoriteNumbersList;
    People[] public people;

    function store(uint256 _favoriteNumber) public virtual {
        // La palabra virtual añadida después de public es para que así cualquier contrato que herede de este, pueda usar una versión modificada de esta función si que le de problemas de compilación.
        favoriteNumber = _favoriteNumber;
    }

    function retrieve() public view returns(uint256){
        return favoriteNumber;
    }

    function addPerson(string memory _name, uint256 _favoriteNumber) public {
            // Aquí lo que estamos haciendo es pushear en el array People un nuevo elemento usando las variables recibidas como parámetros
            people.push(People(_favoriteNumber, _name));
            // Con la línea de abajo lo que estamos haciendo con el mapping es que al filtrar por el string, nos va a devolver el valor que introdujimos por FavoriteNumber en su momento
            nameToFavoriteNumber[_name] = _favoriteNumber;
    }
}

